import type { HealthCheckId } from "./HealthCheckId";
export type SetHealth = {
    id: HealthCheckId;
    name: string;
} & ({
    result: "success";
    message: string | null;
} | {
    result: "disabled";
    message: string | null;
} | {
    result: "starting";
    message: string | null;
} | {
    result: "loading";
    message: string;
} | {
    result: "failure";
    message: string;
});
